(6, 'Ravensburger', 'Utopia', 12696, 15, 4, '6315c4da8497d.jpg', 'ew York, Rio, Tokyo - que diriez-vous de reconstituer en puzzle le plan de votre ville, de votre destination de vacances ou de la ville de vos rêves ? Avec MAPuzzle, vous pouvez faire imprimer n\\\'importe quelle section de carte sous forme de puzzle. Voyagez dans le monde entier depuis chez vous grâce à my Ravensburger puzzle plan urbain : Panama, Paris ou vos montagnes natales, vous pouvez découvrir chaque lieu, chaque ville et chaque recoin de ce monde à travers un puzzle Ravensburger. Pour afficher à la maison ou au bureau ou pour offrir un cadeau original : un puzzle plan urbain personnalisé représente toujours une magnifique idée de décoration !', 0, 0, '2022-08-30 00:00:00'),
(7, 'Ravensburger', 'Nevergame', 954823, 5, 4, '6315c57b4d292.jpg', 'Qingdewan Puzzle 1000 Pièces Puzzle en Bois DIY Résumé du Paysage des Quatre Saisons Jeu D\\\'Intelligence De l\\\'art De La Décoration Moderne Jeu Cadeau Unique', 0, 0, '2022-08-31 00:00:00'),
(8, 'Falcon', 'Parisis', 721588, 21, 5, '6315c5c250ccc.jpg', 'Obcaecati, quo neque nostrum quibusdam nam aspernatur...', 0, 0, '2022-09-01 00:00:00'),
(9, 'Torsen', 'Berlis', 355792, 8, 6, '6315e375e1997.jpg', 'Lorem ipsum dolor sit amet consectetur adipisicing elit...', 0, 0, '2022-09-02 00:00:00'),
(10, 'Jumbo', 'Londis', 355792, 12, 7, '6315f135d7ef4.webp', 'consectetur adipisicing elit neque nostrum quibusdam nam aspernatur...', 0, 0, '2022-09-03 00:00:00'),
(11, 'Mambo', 'Bruxis', 116487, 17, 7, '63204b7a9e8e1.jpg', 'ponais versé dans l’art des caractères étranges pour faire de deux simples lettres de l’alphabet un Cast puzzle de difficulté 3 sur 6. C’est le défi auquel s’est attaqué avec brio Nob Yoshigahara, l’un des 3 plus', 0, 0, '2022-09-13 00:00:00'),
(12, 'Roumjo', 'Romis', 445822, 15, 5, '63204be391ee7.jpg', '3 plus grands collectionneurs de casse-têtes au monde. Ce beau jeu de logique aux formes douces et au toucher satiné est la version aboutie d’une devinette très célèbre dans les années 1900 en Angleterre', 0, 0, '2022-09-13 00:00:00'),
(13, 'Jumbo', 'Madris', 478215, 17, 4, '63204c5ad9d35.jpg', 'Grace à son design élégant, à la qualité de sa fabrication et à sa taille, ce Huzzle cast est un bijou de maniabilité. Ses énigmes astucieuses te révèleront le monde curieux et ondulant des alphabets métallique', 0, 0, '2022-09-14 00:00:00'),
(14, 'Ravensburger', 'Vienis', 935815, 5, 6, '63204cda013d9.jpg', 'Il fallait l’expertise d’un calligraphe japonais versé dans l’art des caractères étranges pour faire de deux simples lettres de l’alphabet un Cast puzzle de difficulté 3 sur 6. C’est le défi auquel s’est attaqué avec brio Nob Yoshigahar', -5, 1, '2022-09-16 00:00:00'),
(15, 'Kimko', 'Tokis', 895422, 14, 7, '63204d5b59c44.jpg', 'Ce beau jeu de logique aux formes douces et au toucher satiné est la version aboutie d’une devinette très célèbre dans les années 1900 en Angleterre. Grace à son design élégant', 0, 0, '2022-09-19 00:00:00'),
(16, 'Ravensburger', 'Dublis', 189642, 18, 6, '63204e3189929.jpg', 'versé dans l’art des caractères étranges pour faire de deux simples lettres de l’alphabet un Cast puzzle de difficulté 3 sur 6. C’est le défi auquel s’est attaqué avec brio Nom Yahara, l’un des 3 plus grands collectionneurs de casse-têtes au monde', 0, 0, '2022-09-23 00:00:00');

